import react from 'react'
import {MDBCard} from 'mdbreact';
import SetGoal from './Goals/Setgoal';

function Goals(){
    return(
        <div>
            <MDBCard style={{paddingTop:"40px"}}>
                <SetGoal></SetGoal>
            </MDBCard>
        </div>
    );

}


export default Goals;
